import React from 'react';
import './Login.css';

const loging = () => {
    console.log('loging click');
}

const join = () => {
    console.log('join click');
}

const findID = () => {
    console.log('findID click');
}

const findPW = () => {
    console.log('findPW click');
}

function Login(){
    return(
        <div className="login">
            {/* // 로그인 로고 */}
            <div className="login__logo">
                <img className="login__logo--img" src="#" alt="logo" />
            </div>

            {/* // 로그인 폼 */}
            <form className="login__form" method="POST">
                <input className="login__form--input login__form--input-id" type="text" placeholder="아이디" />
                <input className="login__form--input login__form--input-pw" type="password" placeholder="비밀번호" />
                <button className="login__form--input login__form--input-login" type="button" onClick={loging}>로그인</button>
            </form>

            {/* // 로그인 메뉴 */}
            <div className="login__navi">
                <button className="login__navi--join" type="button" onClick={join}>회원가입</button>
                <div className="login__navi--find">
                    <button className="login__navi--find-id" type="button" onClick={findID}>아이디</button>
                    /
                    <button className="login__navi--find-pw" type="button" onClick={findPW}>비밀번호 찾기</button>
                </div>
            </div>

            <svg className="login__background" width="375" height="812.875" viewBox="0 0 375 812.875">
                <path id="login__background--orange" data-name="패스 44" d="M0,0V275.116c33.2-4.838,83.262-14.822,100.171-32.535,26.117-27.359,28.221-102.99,130.854-106.781C282.832,133.886,335.3,109.067,375,74.376V0Z" fill="#fccb1c"/>
                <path id="패스_45" data-name="패스 45" d="M103.333,262.529C76,271.2,34.667,249.848,0,287.222v62.49c47.232-4.33,89.593,21.872,129,27.941,60.667,9.343,140.333-4,156.333-114.457,10.576-73.008,58.433-103.88,89.667-116.422V81c-39.7,34.691-92.86,85.847-144.667,87.761C127.7,172.552,139.367,251.091,103.333,262.529Z" transform="translate(0 -53.971)" fill="#f9b61b"/>
                <path id="패스_46" data-name="패스 46" d="M286.667,371.194C273,453.616,216.333,480.645,155.667,471.3c-39.407-6.069-109-34.37-155.667-9.254V985.522H375V259.11C343.766,271.652,298.734,298.418,286.667,371.194Z" transform="translate(0 -172.647)" fill="#f5a21a"/>
            </svg>
        </div>
    );
}

export default Login;
